import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';


export default (props) => {
    const { pos, route } = props;
    if (pos === 'L') {
        if (route !== "") {
            return (
                <>
                    <Link to={'/'+route}><Button variant="outline-danger"><h3>&#60;</h3></Button></Link>
                </>
            ) 
        }
        else {
            return (
                <>
                </>
            ) 
        }
    }
    else if (pos === 'R'){
        if (route !== "") {
            return (
                <>
                   <Link to={'/'+route}><Button variant="outline-danger"><h3>&#62;</h3></Button></Link>
                </>
            )
        } 
    }
}
